  if (activeTooltip !== null && activeTooltip !== tooltipId) {
    closeTooltip();
  }
  setActiveTooltip(tooltipId);
};
\end{code}

This way, if a tooltip is already active and you try to open a new one, it will first close the active one before opening the new one.

Alternatively, you can also modify your `handleMouseOver` function in `MyComponent` to close the active tooltip before opening a new one:

