Here are a few popular compiler optimization techniques with example codes:

**1. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that does not affect the output of the program.

Example:
```c
int foo() {
    int x = 5;
    int y = x * 2; // this line is not used anywhere
    return x;
}
```
The compiler can eliminate the line `int y = x * 2;` because it does not affect the output of the program.

**2. Constant Folding**

Constant folding is a technique where the compiler evaluates constant expressions at compile-time.

Example:
```c
int foo() {
    int x = 5 + 3; // constant expression
    return x;
}
```
The compiler can evaluate the constant expression `5 + 3` at compile-time and replace it with the result `8`.

**3. Loop Unrolling**

Loop unrolling is a technique where the compiler increases the number of iterations in a loop to reduce the overhead of the loop control statements.

Example:
```c
void foo() {
    int i;
    for (i = 0; i < 10; i++) {
        printf("%d\n", i);
    }
}
```
The compiler can unroll the loop to:
```c
void foo() {
    int i;
    for (i = 0; i < 10; i += 4) {
        printf("%d\n", i);
        printf("%d\n", i + 1);
        printf("%d\n", i + 2);
        printf("%d\n", i + 3);
    }
}
```
This reduces the number of loop iterations from 10 to 3.

**4. Register Allocation**

Register allocation is a technique where the compiler assigns variables to registers to reduce memory access.

Example:
```c
int foo() {
    int x = 5;
    int y = x * 2;
    return y;
}
```
The compiler can allocate the variable `x` to a register, eliminating the need to access memory.

**5. Instruction Selection**

Instruction selection is a technique where the compiler chooses the most efficient instruction to perform a task.

Example:
```c
int foo() {
    int x = 5;
    int y = x * 2;
    return y;
}
```
