You should use `cloneElement` when you want to preserve the key, ref, and props of the original element, but you need to add new props or override existing ones.

Here's an example:

```jsx
import React from 'react';

const Parent = () => {
  const child = React.createElement('div', { id: 'child' }, 'Child');
  const clonedChild = React.cloneElement(child, { className: 'new-class' });

  return (
    <div>
      {child}
      {clonedChild}
    </div>
  );
};
```

In this example, `clonedChild` will have the same key, ref, and props as `child`, but with the additional `className` prop.

On the other hand, if you don't need to preserve the key, ref, or props of the original element, you can simply pass the new props directly to the component:

```jsx
import React from 'react';

const Parent = () => {
  return (
    <div>
      <Child id="child" />
      <Child id="child" className="new-class" />
    </div>
  );
};
```

In this case, the two `Child` components will have different keys, refs, and props.

**When to use `cloneElement`?**

* When you need to preserve the key, ref, or props of the original element.
* When you need to add new props or override existing ones without changing the original element.

**When to pass props directly?**

* When you don't need to preserve the key, ref, or props of the original element.
* When you need to create a new element with different props.

