Creating a custom WordPress block with a heading, paragraph, and image involves several steps. Here's a step-by-step guide to help you achieve this:

**Step 1: Set up your development environment**

* Install WordPress locally or on a development server.
* Install a code editor or IDE (Integrated Development Environment) like Visual Studio Code, Sublime Text, or Atom.
* Familiarize yourself with WordPress block development by reading the official documentation: <https://developer.wordpress.org/block-editor/>

**Step 2: Create a new plugin**

* Create a new folder in the `wp-content/plugins` directory of your WordPress installation.
* Name the folder something like `my-custom-block`.
* Inside the folder, create a new file called `my-custom-block.php`.

**Step 3: Define the block**

* In `my-custom-block.php`, add the following code to define the block:
```php
<?php
/**
 * My Custom Block
 *
 * @package My Custom Block
 */

function my_custom_block() {
  register_block_type( 'my-custom-block/my-custom-block', array(
    'title' => __( 'My Custom Block', 'my-custom-block' ),
    'description' => __( 'A custom block with a heading, paragraph, and image.', 'my-custom-block' ),
    'category' => 'common',
    'icon' => 'format-image',
    'attributes' => array(
      'heading' => array(
        'type' => 'string',
        'default' => '',
      ),
      'paragraph' => array(
        'type' => 'string',
        'default' => '',
      ),
      'image' => array(
        'type' => 'object',
        'default' => null,
      ),
    ),
    'edit' => 'MyCustomBlockEdit',
    'save' => 'MyCustomBlockSave',
  ) );
}
add_action( 'init', 'my_custom_block' );
```
This code defines a new block type called `my-custom-block/my-custom-block` with a title, description, category, icon, and attributes for the heading, paragraph, and image.

**Step 4: Create the edit component**

* Create a new file called `edit.js` in the same folder as `my-custom-block.php`.
* Add the following code to define the edit component:
```javascript
import { registerBlockType } from '@wordpress/blocks';
import { InspectorControls } from '@wordpress/block-editor';
import { TextControl, ImageControl } from '@wordpress/components';

const MyCustomBlockEdit = ( props ) => {
  const { attributes, setAttributes } = props;
  const { heading, paragraph, image } = attributes;

  return (
    <div>
      <InspectorControls>
        <TextControl
          label="Heading"
          value={ heading }
          onChange={ ( value ) => setAttributes( { heading: value } ) }
        />
        <TextControl
          label="Paragraph"
          value={ paragraph }
          onChange={ ( value ) => setAttributes( { paragraph: value } ) }
        />
        <ImageControl
          label="Image"
          value={ image }
          onChange={ ( value ) => setAttributes( { image: value } ) }
        />
      </InspectorControls>
      <div>
        <h2>{ heading }</h2>
        <p>{ paragraph }</p>
        { image && (
          <img src={ image.url } alt={ image.alt } />
        ) }
      </div>
    </div>
  );
};

export default MyCustomBlockEdit;
```
